// src/pages/BusinessSolutionsPage.js

import React from 'react';
import '../styles/BusinessSolutionsPage.css';
import oneTimeUse from '../assets/one-time-use.jpg';
import regularSolutions from '../assets/business-solutions.jpg';

const BusinessSolutionsPage = () => {
    return (
        <div className="business-solutions-container">
            <h1 className="business-solutions-header">Business Solutions</h1>
            <div className="business-solutions-section">
                <img src={oneTimeUse} alt="One-Time Use Solutions" className="business-solutions-image" />
                <p className="business-solutions-description">
                    Our one-time use solutions are tailored for specific business needs, providing efficient and effective outcomes for short-term projects.
                </p>
            </div>
            <div className="business-solutions-section">
                <img src={regularSolutions} alt="Regular Solutions" className="business-solutions-image" />
                <p className="business-solutions-description">
                    We offer regular business solutions for ongoing support and services, ensuring your business operations run smoothly and efficiently.
                </p>
            </div>
        </div>
    );
};

export default BusinessSolutionsPage;
